const Home = () => {
    const handleClick = () => {
       console.log('i am a handle click');
    }
    
    const handleClickWithParam = (name) =>{
        console.log ('hello' + name);
    }
    
    return ( 
        <div className="home">
            <h2>this a home page</h2>
            <button onClick={handleClick}>simple button with function without param</button>
            <button onClick={()=>{handleClickWithParam('nawel')}}>button with click function(params) {
                
            }</button>

        </div>
     );
}
 
export default Home;
